import Link from 'next/link';

const Header = (props) => (
    <div>
        <img src="http://pluspng.com/img-png/pokemon-logo-png-pokemon-logo-png-2000.png" alt="Pokemon_Logo" width="200px"/>
        <Link href="/">
            <a>Home</a>
        </Link>
        <Link href='/pokimon'>
            <a>Pokemones</a>
        </Link>
        {props.children}
    </div>
)

export default Header;
